import { useState } from 'react';
import './app.css'



function App() {

  const [login_info, setlogin_info] = useState({});

  const handleChange = (event)=>{
    const values = event.target;
    setlogin_info(values);
  }
  return (
    <>
    <form>
      <label>Enter your surname:
        <input type="text" value={login_info.name}/>
      </label>

      <label>Enter your surname:
        <input type="text" value={login_info.surname}/>
      </label>

      <label>Enter your email:
        <input type="email" value={login_info.email}/>
      </label>

      <label>Enter your password:
        <input type="text" value={login_info.password}/>
      </label>

    </form>
    </>
  );
}

export default App;
